import React from 'react'
import ReactDOM from 'react-dom'

const Course = ({course}) =>{
  return (
    <li>{course.parts.name} {course.parts.exercises}</li>
  )
}



const App = ({course}) => {
  const courserows = () => course.parts.map(part =>
    <Course
      key={part.id}
      course={course}/>)  

  return (
    <div>
      {courserows()}
    </div>
  )
  }

ReactDOM.render(<App />, document.getElementById('root'))
